import './Controls.css';

//callback prop to start button
const Controls = ({ callback }) => (

<div>

  <div className="upArrow" onClick={callback}> Up Arrow </div>
  <div className="downArrow" onClick={callback}> Down Arrow </div>

</div>
)

export default Controls;
